# -*- coding: utf-8 -*-
"""
Created on Sun Dec 13 18:38:17 2020

@author: juanpelvis


Basic demo: Layout creation, basic output and referencing buttons
"""

import PySimpleGUI as sg
def pikachu():
    return b''
pika = pikachu()
# Theme
sg.theme('System Default')
# Layout + menu
menu = [['Menu button',['About','Ok']]]
layout = [[sg.Menu(menu,tearoff=False)],
        [sg.Text("What's your name?")],
          [sg.Input(key='-INPUT-')],
          [sg.Text(size=(40,1), key='-OUTPUT-')],
          [sg.Button('Ok'), sg.Button('Quit')]]
# Create the window
window = sg.Window('Window Title', layout,icon = pika)
# Display and interact with the Window using an Event Loop
while True:
    event, values = window.read()
    # See if user wants to quit or window was closed
    if event == sg.WINDOW_CLOSED or event == 'Quit':
        break
    # Output a message to the window
    if event == 'Ok':
        window['-OUTPUT-'].update('Hello ' + values['-INPUT-'] + "! Thanks for trying PySimpleGUI")
    if event == 'About':
        sg.Popup('This is a Popup','All hail tartiflette',title='About button')
# Finish up by removing from the screen
window.close()